import React from 'react'

const SKMenu = () => {

    const gridStyle = {
        borderRadius: "10px",
        margin: "1em 1em 1em 1em"
    }

    return (
        <div className="column has-background-primary" style={gridStyle}>
            <div>
                <i className="fas fa-2x fa-mail-bulk"></i>
            </div>
            <div>
                <h2>hellow</h2>
            </div>
        </div>
    )
}

export default SKMenu
